import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Col, Row, Container } from "../components/Grid";

class Profile extends Component {

  render() {
    return (
      <Container fluid>

        <Row>
          <Col size="md-10 md-offset-1">
            <article>
              <h1>Synopsis</h1>
            </article>
          </Col>
        </Row>

      </Container>
    );
  }

}

export default Huddle;
